import React from 'react';
import ShowDoc from './ShowDoc';

const doctor = [ 
    {
        name:"Sakib khan",
        img: `http://localhost:5001/doc1.jpg`,
    },
    {
        name:"Shahed Khan",
        img:`http://localhost:5001/doc2.jpg`,
    },
    {
        name:"Dr. Sabrina",
        img:`http://localhost:5001/doc2.jpg`,
    }

]

const Doctors = () => {
    return (
        <div>
            {
                doctor.map(doctor => <ShowDoc doctor ={doctor}></ShowDoc>)
            }
        </div>
    );
};

export default Doctors;
